    C3 = [INF] * (n + 1)
    que = deque()
    que.append((0, 0))
    while len(que) > 0:
        p = que.popleft()
        if C3[p[0]] <= p[1]:
            continue
        C3[p[0]] = p[1]
        for e in E[p[0]]:
            if e[1] == 'L':
                que.append((e[0], p[1]))
    que = deque()
    for i in range(n + 1):
        if C3[i] == 0:
            que.append((i, 0))
    C3 = [INF] * (n + 1)
    while len(que) > 0:
        p = que.popleft()
        if C3[p[0]] <= p[1]:
            continue
        C3[p[0]] = p[1]
        for e in E[p[0]]:
            if e[1] == 'N':
                que.append((e[0], p[1] + 1))
    ans = 10 ** 9
    for i in range(1, n + 1):
        ans = min(ans, C1[i] + C2[i] + C3[i])
    print ans

